function Test2(props){
   return(
       <div style={{backgroundColor:props.color, width:"600px", height:"300px",textAlign:"center", borderRadius:"100px",marginLeft:"500px"}} >
          
           <h1>Name={props.data}  </h1>
         <h2><p>DOB={props.fo}</p></h2>  
       </div>
   )
}
export default Test2;
